import React from 'react';
import { connect } from 'react-redux';
import { fetchStream } from '../../actions';
import Modal from '../Modal';
import history from '../../history';

class StreamDelete extends React.Component {

  componentDidMount() {
    fetchStream(this.props.match.params.id);
  };

  renderActions() {
  return (
    <React.Fragment>
      <button className="ui button negative">Delete2</button>
      <button className="ui button">Cancel2</button>
    </React.Fragment>
  )};

  render() {
    return (
      <div>StreamDelete
        <Modal title="Delete Stream" content="Are you really sure?"
         actions={this.renderActions()} onDismiss={() => history.push('/')} />
      </div>
  )};
}

// const mapStateToProps = (state) => {
//   return { stream: state }
// };

export default connect(null, { fetchStream })(StreamDelete);
